About the film:
Family Guy &quot;(English Family Guy) - American animated sitcom created by Seth McFarlane for broadcaster Fox Broadcasting Company. The plot revolves around the dysfunctional Griffin family, consisting of parents Peter and Lois, their children, Chris, Meg and Stewie and Brian - an anthropomorphic dog. Action sitcom occurs in Quahog, the fictional suburb of Providence, Rhode Island. Much of the humor of the series is in the form of so-called frames, which often have nothing to do with the plot and contain various jokes are sensitive and controversial topics such as politics, slavery, disability, feminism, obesity and others.
